import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';
import Sidebar from '../components/Sidebar';
const Card = (props) => {
    return (
        <div className="card">
            <p>{props.data}</p>
        </div>
    )
}
const Home = () => {

    const MainSection = (props) => {
        return (
            <div className='main-section'>

                <Container>

                <h4 className="custom-font">เรื่องเล่าล่าสุด</h4>
                    <Row>
                        <Col lg={8}>
                            <Card data='big card' />
                        </Col>
                        <Col lg={4}>
                            <Card data='Card data' />
                            <br/><br/><br/><br/><br/>
                            <p>dd</p>
                        </Col>
                    </Row>
                </Container>

            </div>
        )
    }
    return (
        <div>
            <Navbar>
                    <a href="/">
                        <img className='logo' src={require('../resources/img/dearToday.PNG')} />
                    </a>

            </Navbar>

                <Row>
                    <Col className='d-none d-sm-block no-right-padding' lg={2} sm={3}><Sidebar/></Col>

                    <Col className='main' sm={9} ><MainSection /></Col>

                </Row>
        </div>
    );
};

export default Home;
